import './SkaniSearch.css'
import { useForm } from 'react-hook-form'
import { useEffect, useState } from 'react'
import { get, sendForm, ProgressBar } from '../Tools/Utils/Utils'

const SkaniForm = () => {

const Blast = () => {

const {register, handleSubmit} = useForm()
const [databases, setDatabases] = useState()
const [progress, setProgress] = useState(0)

const getSkaniDb = () => {
		get(`/db/skani-sketch`).then(entries => setDatabases(entries.map( entry => { return <option key={ entry._id } value={ entry.name }>{ entry.title }</option> })))
}

useEffect(getSkaniDb, [])

	return (
		<div className='ToolForm'>
			<ProgressBar progress={ progress }/>
			<form onSubmit={ handleSubmit(data => sendForm(data, data.type, setProgress)) }>
				<input {...register("title") } type="text"/>
				<select onChange={val => console.log(val.Event.type)}>
					<option value="/services/skani-search">Search</option>
					<option value="/services/skani-dist">Dist</option>
					<option value="/services/skani-triangle">Triange</option>
				</select>
				<input {...register("query") } type="text" id='QuerySubject'/>
				<input {...register("files") } type="file" id='Subject' multiple/>
				<select required {...register("db") } >
					<option hidden defaultValue="select a Database"/>
					{ databases }
				</select>
				<input {...register("args")} type="text"/>
				<input type="submit"/>
			</form>
		</div>
	)
}

const BlastDb = () => {

	const {register, handleSubmit} = useForm()
	const [progress, setProgress] = useState(0)

	return (
		<div className='ToolForm'>
			<ProgressBar progress={ progress } />
			<form onSubmit={handleSubmit(data => sendForm(data, '/services/skani-sketch', setProgress))}>
				<input {...register("title")} type="text"/>
				<input {...register("query")} type="text"/>
				<input {...register("files")} type="file" multiple/>
				<input type="submit" />
			</form>
		</div>
	)
}

	return(
		<div className={'Form'}>
			<Blast/>
			<BlastDb/>
		</div>
	)

}
export default SkaniForm
